def getHeader(stats):
    """Returns a header for the final output HTML file. The stats variable defines the content to the right of the "DP ATTACK Analyzer" logo"""
    header=f"""\
<html>
  <head>
    <link rel="icon" type="image/x-icon" href={favicon()}>
    <script type="text/javascript" src="https://www.gstatic.com/charts/loader.js">
    google.charts.load('current', {{'packages':['corechart', 'annotationchart']}});
    </script>
    <title>DP Attack Analyzer</title>
    {getCSS()}
  </head>
  <body>
    <table>
      <tr>
        <td width="50%" style="text-align: center; vertical-align: top; border: none;">{logo()}</td>
        <td width="50%" style="border: none; text-align: left;">
{stats}  
        </td>
      </tr>
    </table>
    <script type="text/javascript">
      google.charts.load('current', {{'packages':['corechart']}});
    </script>"""
    return header

def getCSS():
    """Returns CSS to be included in the header."""

    return """<style>
        * {
            font-family: Arial, sans-serif;
        }
        table {
            width: 100%;
            border-collapse: collapse;
            margin-bottom: 20px;
        }
        th, td {
            border: 1px solid black;
            padding: 8px;
            text-align: center;
        }
        th {
            background-color: #f2f2f2;
            text-align: center;
        }
        h2 {
            line-height: 1.5; 
            text-align: center;
        }
        pre {
            white-space: pre-wrap; /* Wraps long text and preserves formatting */
        }
        .above-threshold {
            background-color: #ffcccc;
        }
        .collapsible {
            background-color: #777;
            color: white;
            cursor: pointer;
            padding: 5px;
            width: 100%;
            border: none;
            text-align: center;
            margin: 4px 2px;
            outline: none;
            font-size: 15px;
            text-align: center;
            transition: background-color 0.3s, transform 0.2s;
        }
        .active, .collapsible:hover {
            background-color: #555;
        }
        .content {
            padding: 0 18px;
            display: none;
            overflow: hidden;
            background-color: #f9f9f9;
        }
        .copy-button {
            background-color: #f2f2f2;
            color: black;
            border: None;
            padding: 5px;
            cursor: pointer;
            font-size: 12px;
            font-weight: bold;
            margin-left: 5px;
        }
        .sticky-title th {
            position: sticky;
            top: 0;
            z-index: 3;
            font-size: 1.5em;   /* match <h2> size */
            font-weight: bold;  /* match <h2> weight */
            text-align: center;
            padding: 8px;
            box-shadow: 0 1px 0 #000;
        }
        .sticky-cols th {
            position: sticky;
            top: 2.5em; /* adjust if title row height changes */
            z-index: 2;
            box-shadow: 0 1px 0 #000;
        }
    </style>"""
def favicon():
    """Returns an embedded base64 encoded version of favicon.ico"""
    return 'data:image/x-icon;base64,'

def logo():
    """Returns an embedded base64 encoded version of logo.jpg"""
    return '<img src="data:image/jpeg;base64," alt="logo" />'
